COPY log_soil_moisture_data_management (obs_datetime, obs_number, author, observation) FROM stdin;
2003-07-16 00:00:00	1	Tim Bergsma	I created KBS015 as a clearing house for soil moisture data. Soil moisture data is interesting in itself, but is also used to transform soil nitrogen measurements to a dry-mass basis.  Currently, LTER data is stored in MS Access 2000 databases (.mdb), which presents a connectivity problem: linked tables are not viewable from the web.  My plan is to make KBS015 the official repository of soil moisture data, and to synchronize a local copy in the database where soil N resides, to facilitate the transformation mentioned above.
2003-07-16 00:00:00	2	Tim Bergsma	I imported LTERSoil:SoilMoisture as SoilMoisture and stripped out the MS Access administrative columns.  This is the definitive source of soil moisture data, in my opinion, even though it is not currently available on the web.  I imported LTERSoil:SoilMoisture_Meta as SoilMoistureCampaigns, stripping out the administrative columns.  This is a nice log, but I'm sure it is no longer maintained.
2003-07-16 00:00:00	3	Tim Bergsma	I created the tables Treatments and Replicates (select distinct from SoilMoisture).  I added some appropriate fields.  I created relationships to SoilMoisture, with cascade update, and corrected entries to reflect current usage.  Note that the treatments I recognize are marked 'official'.
2003-07-16 00:00:00	4	Tim Bergsma	InorgN:SoilMoisture has only 1999 and 2000 data (1999sm.xls and 2000smT0.xls).  It has more data for these two years than KBS015:SoilMoisture.  Most records, however, are duplicates.  I contributed 45 unique records from InorgN:SoilMoisture to KBS015:SoilMoisture.
2003-07-16 00:00:00	5	Tim Bergsma	I created the query KBS015-001, restricting output to official treatments.  I changed LTER_Metadata.mdb:DataTables so that KBS015-001 points here, not to InorgN.mdb.
2003-09-13 00:00:00	1	Sven Bohm	Imported 2001 soil moisture data and created a suppression table. But I still need to create the query to use the suppression table
2003-09-16 00:00:00	1	Sven Bohm	Added 2002 smT0 to soil moisture table. I still need to add the dates for 2001 and 2002 to the soil moisture campains table.
